                    <p className='font16_medium'>{`組員 ${memberId}`}</p>
                </div>
                <section className='group_number'>
                    <p>{memberName}</p>
                </section>
            </div>
            {showButton && (
                <button onClick={onClick}>+</button>
            )}
        </div>
    );
};

